import{o,c as e,a as r}from"./index-644da642.js";const a={class:"markdown-body"},d="2025-07-07T00:00:00.000Z",c="2025-07-07T00:00:00.000Z",i="想法",g="实习随笔",h={__name:"实习随笔",setup(n,{expose:p}){return p({frontmatter:{date:"2025-07-07T00:00:00.000Z",updated:"2025-07-07T00:00:00.000Z",category:"想法",summary:"实习随笔"}}),(m,t)=>(o(),e("div",a,t[0]||(t[0]=[r("<h2>1</h2><p>第一周： 感觉很多都是在干打杂，虽然也没有期望什么，更多的是体验吧，还拿到实习证明，就OK了。</p><p>实习内容累倒是不累，但是每天通勤啊，实习第一个月没多少钱啊，一个人租房没人一起玩啊……累、不舒畅的感觉倒是来源于这些方向。</p><p>对<strong>还有作业、论文、报告没写完</strong>， 这就太痛苦了。</p><p>学习到的东西呢：</p><ul><li>公司里的分工、交流都太细、太完善了，好难看清全局</li><li>mentor 一直 是有dll 库， 有开源包可以用吗</li><li>“你先写好一个小 demo 展示”</li><li>还行，现阶段还比较简单，对我来说能实现</li></ul><p>具体的点（详细只是记录文档写在其他文章了）</p><hr><p><strong>WPF 架构</strong></p><p><strong>dll 动态链接库的调用</strong></p><p><strong>adb</strong></p><hr><h2>2</h2><p>又是周五，晚上在阳台吹吹风，看看落日。还挺不错</p><p>这周基于 WPF 框架 的 MVVM 模式写了控制手机的 adb 工具，并做了可视化，等向下周向 mentor， 展示、优化后偷来丢在 GitHub 的仓库里吧。</p><p>mentor 是不是有毛病啊，代码还没给我看，架构没给我看，测试代码没给我看，就给了测试的功能设计说明，叫我设计测试功能的日志记录抽象设计，真就抽象设计，哈哈哈，就记录， 功能参数，返回内容，三点抽象，结束。</p><p>chat 快快加油吧 ，高级算法的作业快帮我做完🥺 。</p><p>写完高级算法作业就可以暂时 好好休息一下喽！</p><hr><h2>3</h2><p>周一任务是对运行功能的抽象，记录在数据库中，进而生成测试用例库，需要满足读取时能够再次调用参数运行，但是大多参数都很多，40多个功能，分几类参数抽象，还是没有很轻松。</p><p>周二还行，虽然没给我什么任务。学习了 prism 的委托、委托的抽象接口，感觉很像 Java 欸，甚至感觉就在写 Java ,还有 viewModel 、 view 通过 prism 自动对接和处理数据 (contextData)。</p><p>明天上班的时候摸鱼整理吧</p><p>稍微有点迷茫，上班完全没有精神上获得什么，只有越来越累，越来越觉得很烦，我要考研，要读研又是为了什么啊。与mentor 交流 实例化 委托的对象的时候，为什么要用 抽象的ICommand、为什么用 DelegateCommand，第一次感受到，那种 “我是程序员啊”， 上学的时候和同学讨论，或者自己写代码，一直给我的感觉是，我在做一件事，我在写作业，我在小组讨论，我在借用 chatGPT 放大我的想法，就是没有感受到过，我是一个开发者……</p><p>很“有幸 ？”，我有了这种感觉？</p>",25)])))}};export{i as category,d as date,h as default,g as summary,c as updated};
